Six friends take a road trip to Galveston in an RV for the wedding of their friend, Kelly. The driver, Johnny, gets lost and they arrive in the small town of Lovelock and his friends Sara, Kate, Melody, Christian, and David, decide to spend the night in the Bed and Breakfast owned by the creepy Mr. Robert Wise. David has an argument with the chef of the inn, Henri, and when the chef is found dead and Mr. Wise has a heart attack in the middle of the night, the local Sheriff suspects the group of travelers and tells his Deputy, Enus to seize the keys to their RV and stay in Lovelock for the duration of the investigation. Then the Sheriff arrests &quot;The Mysterious Drifter&quot; who soon becomes his prime suspect. When the clumsy Johnny accidentally breaks an ancient exotic wooden box belonging to Mr. Wise, he releases the terrible, monstrous &quot;Kuman Thong&quot; and the evil spirit held inside escapes and possesses all the local town folk, transforming them into zombies.


